 "Product Description (Ar)":"الشاشة: شاشة IPS LCD مقاس 6.82 بوصة وبدقة HD+ كبيرة بما يكفي لمشاهدة مقاطع الفيديو ولعب الألعاب وتصفح الويب بشكل مريح. كما أن الشاشة ساطعة وواضحة، مما يسهل رؤيتها حتى في ضوء الشمس المباشر.\n\nالمعالج: معالج MediaTek Helio G37 هو معالج رباعي النواة قادر على التعامل مع معظم المهام اليومية بسهولة. كما يمكنه التعامل مع بعض مهام الألعاب وتحرير الفيديو الخفيفة.\n\nذاكرة الوصول العشوائي (RAM) والتخزين: ذاكرة الوصول العشوائي (RAM) بسعة 4 جيجابايت كافية لتشغيل العديد من التطبيقات في نفس الوقت دون أي تأخير. يجب أن يكون تخزين 128 جيجابايت كافياً لمعظم المستخدمين، ولكن يمكن توسيعه إلى 1 تيرابايت عبر بطاقة microSD إذا لزم الأمر.\n\nالكاميرا الخلفية: نظام الكاميرا الثنائي على الظهر قادر على التقاط صور لائقة في معظم ظروف الإضاءة. المستشعر الرئيسي قادر على التقاط صور حادة ومفصلة، بينما يساعد مستشعر الذكاء الاصطناعي على تحسين الجودة الإجمالية للصور.\n\nالكاميرا الأمامية: كاميرا السيلفي بدقة 8 ميجابكسل جيدة بما يكفي لالتقاط صور سيلفي ومكالمات الفيديو من حين لآخر.\n\nالبطارية: بطارية 6000 مللي أمبير هي واحدة من أكبر البطاريات في هاتف ذكي بأسعار معقولة. يجب أن تكون قادرة على الصمود لمدة يوم كامل من الاستخدام على شحنة واحدة، حتى مع الاستخدام المكثف.\n\nنظام التشغيل: يعمل هاتف Infinix Hot 30 Play 4GB\/128GB على نظام Android 12 Go Edition، وهو إصدار خفيف من Android تم تحسينه للأجهزة منخفضة التكلفة.\n\nالاختلافات الرئيسية بين هاتف Infinix Hot 30 4GB\/128GB و هاتف Infinix Hot 30 Play 4GB\/128GB:\n\nالشاشة: يحتوي هاتف Infinix Hot 30 على شاشة مقاس 6.78 بوصة بدقة FHD+، بينما يحتوي هاتف Infinix Hot 30 Play على شاشة مقاس 6.82 بوصة بدقة HD+.\nالمعالج: يحتوي هاتف Infinix Hot 30 على معالج MediaTek Helio G88، بينما يحتوي هاتف Infinix Hot 30 Play على معالج MediaTek Helio G37.\nالكاميرا الخلفية: يحتوي هاتف Infinix Hot 30 على نظام كاميرا ثلاثي العدسات في الخلف، بينما يحتوي هاتف Infinix Hot 30 Play على نظام كاميرا ثنائي العدسات في الخلف.\nالبطارية: يحتوي هاتف Infinix Hot 30 على بطارية بسعة 5000 مللي أمبير، بينما يحتوي هاتف Infinix Hot 30 Play على بطارية بسعة 6000 مللي أمبير.",
