 "Product Description (Ar)":"الشاشة: شاشة AMOLED مقاس 6.7 بوصة مع معدل تحديث 120 هرتز كبيرة وسلسة، مما يجعلها مثالية لمشاهدة مقاطع الفيديو ولعب الألعاب وتصفح الويب. كما أن الشاشة ساطعة وواضحة، مما يسهل رؤيتها حتى في ضوء الشمس المباشر.\n\nالمعالج: معالج MediaTek Dimensity 920 هو معالج ثماني النواة قادر على التعامل مع معظم المهام اليومية بسهولة. كما يمكنه التعامل مع بعض مهام الألعاب وتحرير الفيديو المتطلبة دون أي تأخير.\n\nذاكرة الوصول العشوائي (RAM) والتخزين: ذاكرة الوصول العشوائي (RAM) بسعة 8 جيجابايت كافية لتشغيل العديد من التطبيقات في نفس الوقت دون أي تأخير. يجب أن يكون تخزين 256 جيجابايت كافياً لمعظم المستخدمين، ولكن يمكن توسيعه إلى 1 تيرابايت عبر بطاقة microSD إذا لزم الأمر.\n\nالكاميرا الخلفية: نظام الكاميرا الثلاثي العدسات على الظهر قادر على التقاط صور لائقة في معظم ظروف الإضاءة. المستشعر الرئيسي بدقة 108 ميجابكسل قادر على التقاط صور حادة ومفصلة، بينما يساعد المستشعر فائق الاتساع بدقة 8 ميجابكسل ومستشعر العمق بدقة 2 ميجابكسل على تحسين الجودة الإجمالية للصور.\n\nالكاميرا الأمامية: كاميرا السيلفي بدقة 60 ميجابكسل هي واحدة من أعلى كاميرات السيلفي دقة في السوق. إنها قادرة على التقاط صور سيلفي حادة ومفصلة، حتى في ظروف الإضاءة المنخفضة.\n\nالبطارية: بطارية 4500 مللي أمبير هي حجم جيد لهاتف ذكي، ويجب أن تكون قادرة على الصمود لمدة يوم كامل من الاستخدام على شحنة واحدة. يدعم الهاتف الشحن السريع بقوة 45 واط، مما يعني أنه يمكن شحن الهاتف بالكامل في وقت قصير.\n\nنظام التشغيل: يعمل هاتف Infinix Zero 20 8GB\/256GB على نظام Android 12، وهو أحدث إصدار من نظام Android.",
