 "description":"Display: The Realme C30S has a 6.5-inch HD+ (1600x720) IPS LCD display with a 20:9 aspect ratio and a waterdrop notch. The display is not the sharpest, but it is bright and colorful enough for everyday use.\n\nProcessor: The Realme C30S is powered by an octa-core Unisoc SC9863A processor. This is a budget-friendly processor that is not the most powerful, but it is sufficient for basic tasks such as browsing the web, checking email, and using social media apps.\n\nMemory: The Realme C30S comes with 8GB of RAM and 64GB of storage. This is a significant improvement over the 4GB\/32GB model, as it offers more RAM for multitasking and more storage for apps, photos, and videos. The storage can also be expanded up to 1TB using a microSD card.\n\nCameras: The Realme C30S has a 5MP front-facing camera and an 8MP rear camera. The front-facing camera is good enough for selfies and video calls, while the rear camera is good enough for taking basic photos in good lighting conditions.\n\nBattery: The Realme C30S has a 5000mAh battery, which is very good for a budget-friendly smartphone. This battery should easily last you all day on a single charge, even with heavy use.\n\nSoftware: The Realme C30S runs Android 12 with Realme UI 3.0 on top. Realme UI is a custom skin that is based on Android and offers a number of additional features and customizations.\n\nOverall, the Realme C30S 8GB\/64GB is a good budget-friendly smartphone with a few key advantages over the 4GB\/32GB model. It offers more RAM for multitasking, more storage for apps, photos, and videos, and a more recent version of Android. The cameras are still not the best, but they are good enough for basic use. If you are looking for a budget-friendly smartphone with these features, then the Realme C30S 8GB\/64GB is a good option.                                                                        color:\"Stripe Blue\nStripe Black\"",
 "Product Description (Ar)":"الشاشة:\n\nشاشة IPS LCD مقاس 6.5 بوصة بدقة HD+ (1600x720) ونسبة عرض إلى ارتفاع 20:9 ونوتش على شكل قطرة ماء.\nالشاشة ليست الأكثر حدة، ولكنها ساطعة وذات ألوان زاهية بما يكفي للاستخدام اليومي.\nالمعالج:\n\nمعالج Unisoc SC9863A ثماني النواة.\nهذا معالج اقتصادي ليس الأكثر قوة، ولكنه كافٍ للمهام الأساسية مثل تصفح الويب وتفقّد البريد الإلكتروني واستخدام تطبيقات التواصل الاجتماعي.\nالذاكرة:\n\n8 جيجابايت من ذاكرة الوصول العشوائي و 64 جيجابايت من التخزين.\nهذه زيادة كبيرة مقارنةً بنموذج 4 جيجابايت \/ 32 جيجابايت، حيث إنها توفر المزيد من ذاكرة الوصول العشوائي للقيام بمهام متعددة والمزيد من التخزين للتطبيقات والصور ومقاطع الفيديو. يمكن أيضًا توسيع التخزين حتى 1 تيرابايت باستخدام بطاقة microSD.\nالكاميرات:\n\nكاميرا أمامية بدقة 5 ميجابكسل وكاميرا خلفية بدقة 8 ميجابكسل.\nالكاميرا الأمامية جيدة بما يكفي للصور الشخصية ومكالمات الفيديو، بينما الكاميرا الخلفية جيدة بما يكفي لالتقاط الصور الأساسية في ظروف الإضاءة الجيدة.\nالبطارية:\n\nبطارية بسعة 5000 مللي أمبير، وهي جيدة جدًا لهاتف ذكي اقتصادي. يجب أن تدوم هذه البطارية بسهولة طوال اليوم بشحنة واحدة، حتى مع الاستخدام المكثف.\nنظام التشغيل:\n\nيعمل هاتف Realme C30S بنظام Android 12 مع واجهة Realme UI 3.0. Realme UI هي واجهة مخصصة تستند إلى Android وتوفر عددًا من الميزات والتخصيصات الإضافية.",
