 "description":"Display: The Realme C33 has a 6.5-inch HD+ (1600x720) IPS LCD display with a 20:9 aspect ratio and a mini-drop notch. The display is not the sharpest, but it is bright and colorful enough for everyday use.\n\nProcessor: The Realme C33 is powered by an octa-core Unisoc T612 processor. This is an entry-level processor that is not the most powerful, but it is sufficient for basic tasks such as browsing the web, checking email, and using social media apps.\n\nMemory: The Realme C33 comes with 8GB of RAM and 128GB of storage. This is a lot of RAM and storage for an entry-level smartphone. The storage can also be expanded up to 1TB using a microSD card.\n\nCameras: The Realme C33 has a 5MP front-facing camera and a 50MP rear camera. The front-facing camera is good enough for selfies and video calls, while the rear camera is good enough for taking basic photos in good lighting conditions.\n\nBattery: The Realme C33 has a 5000mAh battery, which is very good for a budget-friendly smartphone. This battery should easily last you all day on a single charge, even with heavy use.\n\nSoftware: The Realme C33 runs Android 12 with Realme UI 3.0 on top. Realme UI is a custom skin that is based on Android and offers a number of additional features and customizations.                                                                                                                                color: \"Sandy Gold\nAqua Blue\nNight Sea\"",
 "Product Description (Ar)":"الشاشة:\n\nشاشة IPS LCD مقاس 6.5 بوصة بدقة HD+ (1600x720) بنسب عرض إلى ارتفاع 20:9 وثقب قطرة الماء. الشاشة ليست حادة للغاية، ولكنها ساطعة وملونة بما يكفي للاستخدام اليومي.\nالمعالج:\n\nمعالج Unisoc SC9863A ثماني النواة. هذا معالج ميسور التكلفة ليس هو الأكثر قوة، ولكنه كافٍ للمهام الأساسية مثل تصفح الويب وفحص البريد الإلكتروني واستخدام تطبيقات الوسائط الاجتماعية.\nالذاكرة:\n\nيأتي Realme C30S بذاكرة وصول عشوائي (RAM) سعة 8 جيجابايت وتخزين 64 جيجابايت. هذا تحسين كبير مقارنة بطراز 4 جيجابايت\/32 جيجابايت، حيث يوفر ذاكرة وصول عشوائي أكثر للتبديل بين المهام وتخزينًا أكثر للتطبيقات والصور ومقاطع الفيديو. يمكن أيضًا توسيع التخزين حتى 1 تيرابايت باستخدام بطاقة microSD.\nالكاميرات:\n\nيحتوي Realme C30S على كاميرا أمامية بدقة 5 ميجابكسل وكاميرا خلفية بدقة 8 ميجابكسل. الكاميرا الأمامية جيدة بما يكفي للسيلفي ومكالمات الفيديو، بينما الكاميرا الخلفية جيدة بما يكفي لالتقاط صور أساسية في ظروف الإضاءة الجيدة.\nالبطارية:\n\nيحتوي Realme C30S على بطارية بسعة 5000 مللي أمبير، وهي جيدة جدًا لهاتف ذكي ميسور التكلفة. يجب أن تدوم هذه البطارية بسهولة طوال اليوم بشحنة واحدة، حتى مع الاستخدام المكثف.\nنظام التشغيل:\n\nيعمل Realme C30S بنظام Android 12 مع واجهة مستخدم Realme UI 3.0. واجهة Realme UI هي واجهة مخصصة تستند إلى Android وتوفر عددًا من الميزات والتخصيصات الإضافي",
