 "Product Description (Ar)":"الشاشة:\n\nشاشة IPS LCD مقاس 6.6 بوصة بدقة FHD+ (2408x1080) بنسب عرض إلى ارتفاع 20:9 وثقب قطرة الماء. الشاشة حادة وملونة، وهي ساطعة بما يكفي للاستخدام في الهواء الطلق.\nالمعالج:\n\nمعالج Unisoc T616 ثماني النواة. هذا معالج متوسط ​​المدى ليس هو الأكثر قوة، ولكنه كافٍ للمهام الأساسية مثل تصفح الويب وفحص البريد الإلكتروني واستخدام تطبيقات الوسائط الاجتماعية. يمكنه أيضًا التعامل مع بعض الألعاب الخفيفة.\nالذاكرة:\n\nيأتي Realme C35 بذاكرة وصول عشوائي (RAM) سعة 12 جيجابايت وتخزين 128 جيجابايت. هذه ذاكرة وصول عشوائي وتخزين كبيران لهاتف ذكي ميسور التكلفة. يمكن أيضًا توسيع التخزين حتى 1 تيرابايت باستخدام بطاقة microSD.\nالكاميرات:\n\nيحتوي Realme C35 على كاميرا أمامية بدقة 8 ميجابكسل وكاميرا خلفية بدقة 50 ميجابكسل مع مستشعرين إضافيين بدقة 2 ميجابكسل للماكرو والعمق. الكاميرا الأمامية جيدة بما يكفي للسيلفي ومكالمات الفيديو. نظام الكاميرا الخلفية جيد بما يكفي لالتقاط صور أساسية في ظروف الإضاءة الجيدة.\nالبطارية:\n\nيحتوي Realme C35 على بطارية بسعة 5000 مللي أمبير، وهي جيدة جدًا لهاتف ذكي ميسور التكلفة. يجب أن تدوم هذه البطارية بسهولة طوال اليوم بشحنة واحدة، حتى مع الاستخدام المكثف.\nنظام التشغيل:\n\nيعمل Realme C35 بنظام Android 12 مع واجهة مستخدم Realme UI 3.0. واجهة Realme UI هي واجهة مخصصة تستند إلى Android وتوفر عددًا من الميزات والتخصيصات الإضافية.",
