 "description":"Display: The Realme C55 has a 6.72-inch IPS LCD display with a 90Hz refresh rate and a 20:9 aspect ratio. The display is sharp and colorful, and the 90Hz refresh rate makes for a smooth and fluid scrolling experience.\n\nProcessor: The Realme C55 is powered by a MediaTek Helio G88 processor. This is a mid-range processor that is not the most powerful, but it is sufficient for basic tasks such as browsing the web, checking email, and using social media apps. It can also handle some light gaming.\n\nMemory: The Realme C55 comes with 12GB of RAM and 128GB of storage. This is a lot of RAM and storage for a budget-friendly smartphone. The storage can also be expanded up to 1TB using a microSD card.\n\nCamera: The Realme C55 has a 50MP rear camera system with two additional 2MP sensors for macro and depth. The rear camera system is good enough for taking basic photos in good lighting conditions. However, it is not the best in low light conditions.\n\nBattery: The Realme C55 has a 5000mAh battery, which is very good for a budget-friendly smartphone. This battery should easily last you all day on a single charge, even with heavy use.\n\nSoftware: The Realme C55 runs Android 12 with Realme UI 3.0 on top. Realme UI is a custom skin that is based on Android and offers a number of additional features and customizations.                                                                                                                  color:\"Sun Shower\nRainy Night\"",
 "Product Description (Ar)":"الشاشة:\n\nشاشة IPS LCD مقاس 6.72 بوصة بمعدل تحديث 90 هرتز ونسبة عرض إلى ارتفاع 20:9. الشاشة حادة وملونة، ومعدل التحديث 90 هرتز يجعل تجربة التمرير سلسة ومرنة.\nالمعالج:\n\nمدعوم بمعالج MediaTek Helio G88. هذا معالج متوسط ​​المدى ليس هو الأكثر قوة، ولكنه كافٍ للمهام الأساسية مثل تصفح الويب وفحص البريد الإلكتروني واستخدام تطبيقات الوسائط الاجتماعية. يمكنه أيضًا التعامل مع بعض الألعاب الخفيفة.\nالذاكرة:\n\nيأتي Realme C55 بذاكرة وصول عشوائي (RAM) سعة 12 جيجابايت وتخزين 128 جيجابايت. هذه ذاكرة وصول عشوائي وتخزين كبيران لهاتف ذكي ميسور التكلفة. يمكن أيضًا توسيع التخزين حتى 1 تيرابايت باستخدام بطاقة microSD.\nالكاميرا:\n\nيحتوي Realme C55 على نظام كاميرا خلفية بدقة 50 ميجابكسل مع مستشعرين إضافيين بدقة 2 ميجابكسل للماكرو والعمق. نظام الكاميرا الخلفية جيد بما يكفي لالتقاط صور أساسية في ظروف الإضاءة الجيدة. ومع ذلك، فهو ليس الأفضل في ظروف الإضاءة المنخفضة.\nالبطارية:\n\nيحتوي Realme C55 على بطارية بسعة 5000 مللي أمبير، وهي جيدة جدًا لهاتف ذكي ميسور التكلفة. يجب أن تدوم هذه البطارية بسهولة طوال اليوم بشحنة واحدة، حتى مع الاستخدام المكثف.\nنظام التشغيل:\n\nيعمل Realme C55 بنظام Android 12 مع واجهة مستخدم Realme UI 3.0. واجهة Realme UI هي واجهة مخصصة تستند إلى Android وتوفر عددًا من الميزات والتخصيصات الإضافية.",
