 "Product Description (Ar)":"الشاشة:\n\nشاشة AMOLED مقاس 6.7 بوصة بمعدل تحديث 120 هرتز ونسبة عرض إلى ارتفاع 20:9. الشاشة حادة وملونة ومشرقة، ومعدل التحديث 120 هرتز يجعل تجربة التمرير سلسة ومرنة.\nالمعالج:\n\nمدعوم بمعالج MediaTek Dimensity 8100. هذا معالج رائد من حيث الأداء قوي للغاية وقادر. يمكنه التعامل مع حتى أصعب المهام بسهولة.\nالذاكرة:\n\nيأتي Realme GT Neo 3 بذاكرة وصول عشوائي (RAM) سعة 24 جيجابايت من نوع LPDDR5 وذاكرة تخزين 256 جيجابايت من نوع UFS 3.1. هذه ذاكرة وصول عشوائي وتخزين كبيران لهاتف ذكي. ذاكرة الوصول العشوائي LPDDR5 سريعة جدًا ومتجاوبة، وذاكرة التخزين UFS 3.1 سريعة جدًا أيضًا.\nالكاميرا:\n\nيحتوي Realme GT Neo 3 على نظام كاميرا خلفية بدقة 50 ميجابكسل مع مستشعرين إضافيين بدقة 8 ميجابكسل للتصوير العريض والماكرو. نظام الكاميرا الخلفية جيد بما يكفي لالتقاط صور حادة ومفصلة في ظروف الإضاءة الجيدة. ومع ذلك، فهو ليس الأفضل في ظروف الإضاءة المنخفضة.\nالبطارية:\n\nيحتوي Realme GT Neo 3 على بطارية بسعة 4500 مللي أمبير مع شحن سريع بقوة 150 وات. البطارية كبيرة بما يكفي لتدوم معظم المستخدمين يومًا كاملاً بشحنة واحدة، والشحن السريع بقوة 150 وات يسمح لك بشحن الهاتف من 0 إلى 100٪ في 17 دقيقة فقط.\nنظام التشغيل:\n\nيعمل Realme GT Neo 3 بنظام Android 12 مع واجهة مستخدم Realme UI 3.0. واجهة Realme UI هي واجهة مخصصة تستند إلى Android وتوفر عددًا من الميزات والتخصيصات الإضافية.",
