 "Product Description (Ar)":"الشاشة: يتميز Honor X6 بشاشة LCD بحجم 6.5 بوصة وبدقة 720P ونسبة عرض إلى ارتفاع تبلغ 20:9. الشاشة حادة ومشرقة، لكن الألوان ليست نابضة بالحياة كما هي في الهواتف الذكية الأكثر تكلفة.\n\nالمعالج: يعمل Honor X6 بمعالج MediaTek Helio G25. هذا معالج متوسط ​​المدى ليس الأكثر قوة، لكنه كافٍ للمهام الأساسية مثل تصفح الويب وتفقّد البريد الإلكتروني واستخدام تطبيقات وسائل التواصل الاجتماعي. كما يمكنه التعامل مع بعض الألعاب الخفيفة.\n\nالذاكرة: يأتي Honor X6 مع 4GB من ذاكرة الوصول العشوائي و 64GB من التخزين. هذه ذاكرة وصول عشوائي كافية لمعظم المستخدمين، لكن التخزين قد يكون محدودًا لبعض المستخدمين، خاصةً إذا كنت ترغب في التقاط الكثير من الصور ومقاطع الفيديو. يمكن أيضًا توسيع التخزين إلى 1 تيرابايت باستخدام بطاقة microSD.\n\nالكاميرا: يحتوي Honor X6 على نظام كاميرا خلفية بدقة 50 ميجابكسل مع مستشعر ماكرو بدقة 2 ميجابكسل. نظام الكاميرا الخلفية جيد بما يكفي لالتقاط صور حادة ومفصلة في ظروف الإضاءة الجيدة. ومع ذلك، فهو ليس الأفضل في ظروف الإضاءة المنخفضة.\n\nالبطارية: يحتوي Honor X6 على بطارية بسعة 5000 مللي أمبير مع شحن بقوة 10 وات. البطارية كبيرة بما يكفي لتستمر معظم المستخدمين لمدة يوم كامل بشحنة واحدة، لكن سرعة الشحن بطيئة نسبيًا.\n\nالبرنامج: يعمل Honor X6 بنظام Android 12 مع Magic UI 6.1 في الأعلى. Magic UI هو واجهة مستخدم مخصصة تستند إلى Android وتقدم عددًا من الميزات والتخصيصات الإضافية.",
