 "Product Title (Ar)":"تيلكاست P25ST واي فاي 64 جيجابايت\/4 جيجابايت",
 "color":"Blue",
 "size":"64GB",
 "description":"Display: The Teclast P25ST WiFi has a 10.1-inch IPS display with a 1920x1200 resolution and a 16:10 aspect ratio. The display is sharp, bright, and has good viewing angles.\n\nProcessor: The Teclast P25ST WiFi is powered by a MediaTek Helio P22T processor. This is a low-end processor that is not the most powerful, but it is sufficient for basic tasks such as browsing the web, watching videos, and playing games. It can also handle some light gaming.\n\nMemory: The Teclast P25ST WiFi comes with 4GB of RAM and 64GB of storage. This is enough RAM for most users, but the storage could be a bit limiting for some users, especially if you like to download a lot of apps and games. The storage can also be expanded up to 1TB using a microSD card.\n\nCamera: The Teclast P25ST WiFi has an 8MP rear camera and a 5MP front camera. The rear camera is good enough for taking basic photos and videos in good lighting conditions. However, it is not the best in low light conditions. The front camera is good enough for video calls and selfies.\n\nBattery: The Teclast P25ST WiFi has a 6000mAh battery. This is a large battery that is large enough to last most users a full day on a single charge.\n\nSoftware: The Teclast P25ST WiFi runs Android 12. Android 12 is the latest version of Android and it offers a number of new features and improvements.",
 "Product Description (Ar)":"الشاشة: يتميز Teclast P25ST WiFi بشاشة IPS مقاس 10.1 بوصة بدقة 1920x1200 ونسبة عرض إلى ارتفاع 16:10. الشاشة حادة ومشرقة ولها زوايا مشاهدة جيدة.\n\nالمعالج: يعمل Teclast P25ST WiFi بمعالج MediaTek Helio P22T. هذا معالج منخفض المستوى ليس الأكثر قوة، لكنه كافٍ للمهام الأساسية مثل تصفح الويب ومشاهدة مقاطع الفيديو ولعب الألعاب. كما يمكنه التعامل مع بعض الألعاب الخفيفة.\n\nالذاكرة: يأتي Teclast P25ST WiFi مع 4GB من ذاكرة الوصول العشوائي و 64GB من التخزين. هذه ذاكرة وصول عشوائي كافية لمعظم المستخدمين، لكن التخزين قد يكون محدودًا لبعض المستخدمين، خاصةً إذا كنت ترغب في تنزيل الكثير من التطبيقات والألعاب. يمكن أيضًا توسيع التخزين إلى 1 تيرابايت باستخدام بطاقة microSD.\n\nالكاميرا: يحتوي Teclast P25ST WiFi على كاميرا خلفية بدقة 8 ميجابكسل وكاميرا أمامية بدقة 5 ميجابكسل. الكاميرا الخلفية جيدة بما يكفي لالتقاط الصور ومقاطع الفيديو الأساسية في ظروف الإضاءة الجيدة. ومع ذلك، فهي ليست الأفضل في ظروف الإضاءة المنخفضة. الكاميرا الأمامية جيدة بما يكفي لمكالمات الفيديو والصور الشخصية.\n\nالبطارية: يحتوي Teclast P25ST WiFi على بطارية بسعة 6000 مللي أمبير. هذه بطارية كبيرة بما يكفي لتستمر معظم المستخدمين لمدة يوم كامل بشحنة واحدة.\n\nالبرنامج: يعمل Teclast P25ST WiFi بنظام Android 12. Android 12 هو أحدث إصدار من Android ويقدم عددًا من الميزات والتحسينات الجديدة.",
