 "Product Description (Ar)":"الشاشة:\n\nشاشة IPS مقاس 10.1 بوصة بدقة 1920x1200 ونسبة عرض إلى ارتفاع 16:10\nالشاشة حادة، ومشرقة، ولها زوايا مشاهدة جيدة.\nالمعالج:\n\nمعالج MediaTek Helio P22T\nمعالج منخفض التكلفة ليس هو الأكثر قوة، ولكنه كافٍ للمهام الأساسية مثل تصفح الويب ومشاهدة مقاطع الفيديو ولعب الألعاب. يمكنه أيضًا التعامل مع بعض الألعاب الخفيفة.\nالذاكرة:\n\n4 جيجابايت من ذاكرة الوصول العشوائي و 64 جيجابايت من التخزين\nهذه ذاكرة وصول عشوائي كافية لمعظم المستخدمين، ولكن التخزين قد يكون محدودًا قليلاً لبعض المستخدمين، خاصة إذا كنت تحب تنزيل الكثير من التطبيقات والألعاب. يمكن أيضًا توسيع التخزين حتى 1 تيرابايت باستخدام بطاقة microSD.\nالكاميرا:\n\nكاميرا خلفية بدقة 8 ميجابكسل وكاميرا أمامية بدقة 5 ميجابكسل\nالكاميرا الخلفية جيدة بما يكفي لالتقاط الصور ومقاطع الفيديو الأساسية في ظروف الإضاءة الجيدة. ومع ذلك، فهي ليست الأفضل في ظروف الإضاءة المنخفضة. الكاميرا الأمامية جيدة بما يكفي لمكالمات الفيديو والصور الشخصية.\nالبطارية:\n\nبطارية بسعة 6000 مللي أمبير\nهذه بطارية كبيرة بما يكفي لتدوم معظم المستخدمين يومًا كاملاً بشحنة واحدة.\nنظام التشغيل:\n\nAndroid 12\nAndroid 12 هو أحدث إصدار من Android ويوفر عددًا من الميزات والتحسينات الجديدة.",
