 "Product Description (Ar)":"\nمُصنَّع من التيتانيوم — يتميز iPhone 15 Pro Max بتصميم قوي وخفيف من التيتانيوم المصنف للطيران مع ظهر من الزجاج غير اللامع ذي الملمس. كما أنه يتميز بشاشة Ceramic Shield الأمامية التي تعد أقوى من أي زجاج للهاتف الذكي. وهو مقاوم للرذاذ والماء والغبار.\n\nشاشة متقدمة — تصل شاشة Super Retina XDR مقاس 6.7 بوصة2 مع ProMotion إلى معدل تحديث يصل إلى 120 هرتز عندما تحتاج إلى أداء رسومات استثنائي. تقوم Dynamic Island بعرض التنبيهات والأنشطة الحية. بالإضافة إلى ذلك ، مع شاشة Always-On ، تظل شاشة القفل مرئية ، لذلك لا يتعين عليك النقر عليها لتظل على اطلاع.\n\nشريحة A17 Pro المبتكرة — تجعل وحدة معالجة الرسومات (GPU) من فئة Pro الألعاب المحمولة تبدو غامرة للغاية ، مع بيئات غنية وشخصيات واقعية. كما أن A17 Pro كفء بشكل لا يصدق ويساعد على تقديم عمر بطارية مذهل طوال اليوم.\n\nنظام كاميرا Pro القوي — احصل على مرونة تأطير لا تصدق مع 7 عدسات احترافية. التقط صورًا عالية الدقة للغاية مع المزيد من الألوان والتفاصيل باستخدام الكاميرا الرئيسية بدقة 48 ميجابكسل. والتقط صورًا مقربة أكثر وضوحًا من مسافة أبعد باستخدام كاميرا Telephoto بدقة 5x على iPhone 15 Pro Max.\n\nزر الإجراء القابل للتخصيص — يعد زر الإجراء مسارًا سريعًا إلى الميزة المفضلة لديك. ما عليك سوى ضبط الميزة التي تريدها ، مثل الوضع الصامت أو الكاميرا أو المذكرة الصوتية أو الاختصار أو أكثر. ثم اضغط مع الاستمرار لبدء الإجراء.",
