 "Number": 480,
 "category":"6626621e64eb90cb1aa850bb",
 "brand":"6624d596162b654e96aa173d",
 "name":"Apple iPhone 14 Pro 1 TB - 5G",
 "Product Title (Ar)":"ابل ايفون 14 برو 1 تيرابايت - 5G",
 "color":"Black",
 "size":"1TB",
 "description":"6.1-inch Super Retina XDR display featuring Always-On and ProMotion\n\nDynamic Island, a magical new way to interact with iPhone\n48MP Main camera for up to 4x greater resolution\nCinematic mode now in 4K Dolby Vision up to 30 fps\nAction mode for smooth, steady, handheld videos\nVital safety technology—Crash Detection calls for help when you can’t\nAll-day battery life and up to 23 hours of video playback\nA16 Bionic, the ultimate smartphone chip. Superfast 5G cellular\nIndustry-leading durability features with Ceramic Shield and water resistance\niOS 16 offers even more ways to personalize, communicate, and share",
 "Product Description (Ar)":"شاشة Super Retina XDR مقاس 6.1 بوصة مزودة بتقنية Always-On و ProMotion، مما يسمح لك بالاطلاع على معلومات مهمة دون الحاجة إلى تشغيل الشاشة بالكامل.\nDynamic Island، طريقة جديدة سحرية للتفاعل مع iPhone، تتيح لك الوصول إلى التطبيقات والميزات المفضلة لديك بنقرة واحدة.\nكاميرا رئيسية بدقة 48 ميجابكسل لزيادة الدقة بما يصل إلى 4 مرات، مما يتيح لك التقاط صور ومقاطع فيديو أكثر تفصيلاً.\nوضع سينمائي الآن بدقة 4K Dolby Vision حتى 30 إطارًا في الثانية، مما يتيح لك إنشاء مقاطع فيديو احترافية بتأثيرات سينمائية.\nوضع الحركة لمقاطع فيديو سلسة وثابتة باليد، حتى أثناء التنقل.\nتقنية سلامة حيوية - تتصل اكتشاف الأعطال بالطوارئ عندما لا يمكنك ذلك، مما يساعد على إنقاذ الأرواح.\nعمر بطارية يدوم طوال اليوم وما يصل إلى 23 ساعة من تشغيل الفيديو، مما يسمح لك بالاستمتاع بجهاز iPhone الخاص بك طوال اليوم.\nشريحة A16 Bionic، شريحة الهاتف الذكي الأفضل على الإطلاق، توفر أداءً مذهلاً وعمر بطارية أطول.\nشبكة خلوية 5G فائقة السرعة، مما يتيح لك تنزيل الملفات وبث الفيديوات بسرعة فائقة.\nميزات متانة رائدة في الصناعة مع Ceramic Shield ومقاومة الماء، مما يحمي جهاز iPhone الخاص بك من الخدوش والصدمات والسوائل.\nيقدم iOS 16 المزيد من الطرق للتخصيص والتواصل والمشاركة، مما يجعل جهاز iPhone الخاص بك أكثر فائدة وإنتاجية.",
 "price": 1330,
 "number_quantity": 10,
 "sku":"0300089840a"
