 "color":"Green",
 "size":"128GB",
 "description":"OnePlus Pad, a compact & powerful tablet. It features an 11.61-inch LCD display, 8GB RAM, and 128GB storage for smooth performance and ample storage space. Powered by the MediaTek Dimensity 9000 processor and running on Android 13.1, it ensures a seamless user experience. Enjoy stunning visuals with a 144Hz refresh rate & immersive audio with Dolby Vision Atmos.\n\nThe OnePlus Pad offers a stunning 3K+ display with an 11.61-inch size and a 7:5 read-fit ratio. It utilizes an IPS LCD panel and boasts a WQHD+ resolution of 2800x2000, delivering high-quality visuals with a Dolby Vision display and a pixel density of 296 PPI. With a maximum brightness of 500 nits and a smooth 144Hz screen refresh rate, the display offers an immersive viewing experience. The tablet supports 10-Bit true color, ensuring accurate and vibrant color representation.\n\nThe OnePlus Pad comes equipped with calling capabilities and can utilize smartphone cellular data through the Auto Connect feature. It offers a generous storage capacity of 8GB RAM and 128GB of internal storage, allowing for smooth multitasking and ample space for your files.\n\nPowered by the advanced flagship MediaTek Dimensity 9000 chipset and running on the Android 13 operating system, the OnePlus Pad delivers powerful performance and a seamless user experience. Capture memorable moments with the 8MP front and 13MP back cameras, which support 4K recording and are accompanied by a camera flash.\n\nEnjoy special features such as Palm Rejection, which enhances usability, and Quad Speakers with Dolby Atmos, providing immersive audio quality. The OnePlus Pad is compatible with external HDDs and offers a Central Portrait mode for stunning portrait shots.\n\nEnhance your productivity with the optional OnePlus Stylus and Keyboard accessories (sold separately), offering additional convenience and versatility.             color:Halo Green",
 "Product Description (Ar)":"ميزات الجهاز:\n\nشاشة LCD بحجم 11.61 بوصة\nذاكرة وصول عشوائي بسعة 8 جيجابايت\nسعة تخزين 128 جيجابايت\nمعالج MediaTek Dimensity 9000\nنظام Android 13.1\nمعدل تحديث 144 هرتز\nصوت Dolby Vision Atmos\nدعم المكالمات\nتخزين كبير\nأداء قوي\nكاميرات أمامية 8 ميجابكسل وخلفية 13 ميجابكسل\nميزات خاصة مثل Palm Rejection و Quad Speakers مع Dolby Atmos\nمتوافق مع محركات الأقراص الصلبة الخارجية\nيدعم وضع Central Portrait\nمتوافق مع OnePlus Stylus و Keyboard (مباعان بشكل منفصل)\nالوصف:\n\nOnePlus Pad هو جهاز لوحي مضغوط وقوي. يتميز بشاشة LCD بحجم 11.61 بوصة وذاكرة وصول عشوائي بسعة 8 جيجابايت وسعة تخزين 128 جيجابايت لأداء سلس ومساحة تخزين كافية. مدعوم بمعالج MediaTek Dimensity 9000 ويعمل بنظام Android 13.1، يضمن تجربة مستخدم سلسة. استمتع بمرئيات مذهلة بمعدل تحديث 144 هرتز وصوت غامر مع Dolby Vision Atmos.\n\nيقدم OnePlus Pad شاشة مذهلة 3K+ بحجم 11.61 بوصة ونسبة عرض إلى ارتفاع تبلغ 7:5. تستخدم لوحة IPS LCD وتتميز بدقة WQHD+ تبلغ 2800x2000، مما يوفر صورًا عالية الجودة مع شاشة Dolby Vision وكثافة بكسل تبلغ 296 بكسل لكل بوصة. مع سطوع أقصى يبلغ 500 شمعة في المتر المربع ومعدل تحديث الشاشة السلس الذي يبلغ 144 هرتز، توفر الشاشة تجربة مشاهدة غامرة. يدعم الجهاز اللوحي الألوان الحقيقية 10 بت، مما يضمن تمثيل الألوان الدقيق والحيوي.\n\nيأتي OnePlus Pad مزودًا بقدرات الاتصال ويمكنه استخدام بيانات الهاتف الخليوي من خلال ميزة Auto Connect. كما أنه يوفر سعة تخزين سخية تبلغ 8 جيجابايت من ذاكرة الوصول العشوائي و 128 جيجابايت من التخزين الداخلي، مما يسمح بالقيام بمهام متعددة بسلاسة ومساحة كبيرة للملفات الخاصة بك.\n\nمدعومًا بمعالج MediaTek Dimensity 9000 الرائد المتقدم ويعمل بنظام التشغيل Android 13، يقدم OnePlus Pad أداءً قويًا وتجربة مستخدم سلسة. التقط لحظات لا تنسى بكاميرا أمامية 8 ميجابكسل وخلفية 13 ميجابكسل تدعم التسجيل بدقة 4K وتأتي مصحوبة بفلاش كاميرا.\n\nاستمتع بميزات خاصة مثل Palm Rejection، التي تعمل على تحسين الاستخدام، و Quad Speakers مع Dolby Atmos، والتي توفر جودة صوت غامرة. الجهاز اللوحي OnePlus Pad متوافق مع محركات الأقراص الصلبة الخارجية ويوفر وضع Central Portrait لالتقاط صور بورتريه مذهلة.\n\nحسِّن إنتاجيتك باستخدام ملحقات OnePlus Stylus و Keyboard الاختيارية (تباع بشكل منفصل)، والتي توفر الراحة والتنوع الإضافيين.",
