 "description":"Brand        OnePlus\nModel Name        10T 5G\nWireless Carrier        Unlocked for All Carriers\nOperating System        Android 12.0\nCellular Technology        LTE, GSM, WCDMA\nMemory Storage Capacity        256 GB\nConnectivity Technology        Bluetooth, Wi-Fi, USB, NFC\nColor        Moonstone Black\nScreen Size        6.7 Inches\nWireless network technology        GSM, CDMA, LTE\n5G Unlocked - Compatible with 5G networks on AT&T, Verizon, T-Mobile, Visible, MetroPCS, Mint Mobile, Google Fi and Cricket. Up to 4G on Tracfone.\n125W SUPERVOOC Endurance Edition - A day's power in 10 minutes and double the battery lifespan. An AI algorithm intelligently learns your individual charging schedule to deliver the fastest charging speed.\nFlagship Snapdragon 8+ Gen 1 Mobile Platform - The fastest Snapdragon mobile platform delivers ultimate performance at your fingertips through 10% higher CPU and x4 Faster AI Speed.\n50MP Triple Camera System - Flagship level IMX766 sensor with OIS delivers outstanding clarity and stability + Next-gen Nightscape 2.0 and ultra-fast shutter capture speeds.\n6.7\"120Hz FHD+ Fluid Display - With up to 120Hz adaptive frame rate plus always-on HDR10+ and 10-bit colour for superior brightness and colour accuracy.\n16GB RAM and the Always Alive feature deliver uncompromising multitasking. Run up to 30 apps smoothly in the background. Plus HyperBoost Gaming Engine with GPA Frame Stabilizer and GLC (GPU Load Control) for the most compelling gaming experience.                                                                                                                            color:Moonstone Black",
 "Product Description (Ar)":"المواصفات:\n\nالعلامة التجارية: OnePlus\nاسم الطراز: 10T 5G\nمزود الخدمة اللاسلكي: غير مقفل لجميع شركات الاتصالات\nنظام التشغيل: Android 12.0\nتقنية الخلوية: LTE و GSM و WCDMA\nسعة تخزين الذاكرة: 256 جيجابايت\nتقنية الاتصال: Bluetooth و Wi-Fi و USB و NFC\nاللون: الأسود القمري\nحجم الشاشة: 6.7 بوصة\nتقنية الشبكة اللاسلكية: GSM و CDMA و LTE\nغير مقفل لشبكات 5G - متوافق مع شبكات 5G على AT&T و Verizon و T-Mobile و Visible و MetroPCS و Mint Mobile و Google Fi و Cricket. ما يصل إلى 4G على Tracfone.\n125 واط SUPERVOOC Endurance Edition - قوة يوم في 10 دقائق وعمر بطارية مضاعف. تتعلم خوارزمية الذكاء الاصطناعي جدول شحنك الفردي بشكل ذكي لتوفير أسرع سرعة شحن.\nمنصة الهاتف المحمول الرائدة Snapdragon 8+ Gen 1 - تقدم أسرع منصة هاتف محمول Snapdragon أداءً فائقًا في متناول يدك من خلال وحدة المعالجة المركزية الأعلى بنسبة 10% وسرعة الذكاء الاصطناعي أسرع أربع مرات.\nنظام الكاميرا الثلاثي بدقة 50 ميجابكسل - مستشعر IMX766 الرائد مع OIS يوفر وضوحًا وثباتًا استثنائيين + Nightscape 2.0 من الجيل التالي وسرعات مصراع فائقة السرعة.\nشاشة Fluid Display بحجم 6.7 بوصة وبدقة FHD+ ومعدل تحديث 120 هرتز - مع معدل إطارات متكيف يصل إلى 120 هرتز بالإضافة إلى HDR10+ و 10 بت دائمًا لتوفير سطوع ودقة ألوان فائقة.\nتوفر ذاكرة الوصول العشوائي بسعة 16 جيجابايت وميزة Always Alive تعدد المهام دون المساومة. قم بتشغيل ما يصل إلى 30 تطبيقًا بسلاسة في الخلفية. بالإضافة إلى محرك الألعاب HyperBoost مع مثبت الإطار GPA و GLC (التحكم في تحميل وحدة معالجة الرسومات) للحصول على تجربة ألعاب رائعة.",
