 "description":"Brand        ONEPLUS\nModel name        OnePlus 10 Pro\nWireless carrier        Unlocked for All Carriers\nOperating system        OxygenOS\nCellular technology        5G\nMemory storage capacity        256 GB\nConnectivity technology        USB\nColour        Volcanic Black\nScreen size        6.7 Inches\nWireless network technology        GSM\nUnleash the power of 5G | Powered by the latest Qualcomm Snapdragon 8 Gen 1 processor, the 10 Pro is capable of blazing-fast 5G speeds. [5G network only compatible with TMO, Verizon, Google Fi, Mint Mobile] *5G available in selected areas..Form_factor : Bar\nPowerful triple camera System, co-developed with Hasselblad | Featuring a primary 48MP Sony IMX sensor, the 10 Pro captures stunning natural colors & can shoot up to 8k video.\nCapture the bigger picture with a 150º Ultra-Wide Camera | A versatile 50MP ultra-wide sensor shoots with an expansive 150º field-of-view, enabling you to take your creativity to a whole new level.\nOnePlus Billion Color Solution for Photography | The 10 Pro can process 64x more color information with the new OnePlus Billion Color Solution, allowing you to capture & reproduce the most accurate colors.\nSmart 120Hz Display with LTPO 2.0 | The stunning 6.7” QHD+ screen can adjust refresh rate dynamically from 1Hz up to 120Hz, delivering a fluid user experience with optimized battery performance.\nThe best performance for mobile gaming enthusiasts | HyperBoost Gaming Engine takes your gaming to the next level by optimizing graphics & performance, along with a next-gen heat dissipation system, making the 10 Pro an excellent choice for mobile gamers.\nCharge forward with 65W fast charging\/50W Wireless Charging | Get a day’s power in 15 minutes with 65W SuperVOOC Charging and in 30 minutes with 50W wireless charging.\nLarge 5000mAh Battery | Spend less time connected to your charger with a massive 5000mAh battery, perfect for power users.\nAlexa Hands-Free capable | Download the Alexa app to use Alexa hands-free. Play music, make calls, hear news, open apps, navigate, and more, all using just your voice, while on-the-go.\nDisclaimer: If your device is not receiving text messages or experiencing error when making phone calls, you need to contact carriers' technical support to add CDMALess feature.; Included components: oneplus 10 pro, 65w supervooc power adapter, type-c cable, quick start guide, welcome letter, safety information and warranty card, sim tray ejector, usb dongle (type-a to type-c )                                                   color:Volcanic Black  \\\\Green\n",
 "Product Description (Ar)":"المواصفات:\n\nالعلامة التجارية: ONEPLUS\nاسم الطراز: OnePlus 10 Pro\nمزود الخدمة اللاسلكي: غير مقفل لجميع شركات الاتصالات\nنظام التشغيل: OxygenOS\nتقنية الخلوية: 5G\nسعة تخزين الذاكرة: 256 جيجابايت\nتقنية الاتصال: USB\nاللون: الأسود البركاني\nحجم الشاشة: 6.7 بوصة\nتقنية الشبكة اللاسلكية: GSM\nالميزات:\n\nأطلق العنان لقوة 5G | بفضل أحدث معالج Qualcomm Snapdragon 8 Gen 1 ، فإن 10 Pro قادر على سرعات 5G فائقة السرعة.\nنظام كاميرا ثلاثي قوي تم تطويره بالاشتراك مع Hasselblad | مزودًا بمستشعر Sony IMX الأساسي بدقة 48 ميجابكسل ، يلتقط 10 Pro ألوانًا طبيعية مذهلة ويمكنه تصوير فيديو يصل إلى 8 كيلو بايت.\nالتقط الصورة الأكبر مع كاميرا فائقة الاتساع 150 درجة | يلتقط مستشعر فائق الاتساع متعدد الاستخدامات بدقة 50 ميجابكسل بمنظور واسع 150 درجة ، مما يتيح لك أخذ إبداعك إلى مستوى جديد تمامًا.\nحل OnePlus Billion Color للتصوير الفوتوغرافي | يمكن لـ 10 Pro معالجة معلومات الألوان أكثر بـ 64 مرة مع حل OnePlus Billion Color Solution الجديد ، مما يسمح لك بالتقاط واستنساخ الألوان الأكثر دقة.\nشاشة ذكية 120 هرتز مع LTPO 2.0 | يمكن للشاشة المذهلة بحجم 6.7 بوصة QHD + ضبط معدل التحديث بشكل ديناميكي من 1 هرتز إلى 120 هرتز ، مما يوفر تجربة مستخدم سلسة مع أداء بطارية محسن.\nأفضل أداء لعشاق ألعاب الجوال | تأخذ HyperBoost Gaming Engine لعبتك إلى المستوى التالي من خلال تحسين الرسومات والأداء ، بالإضافة إلى نظام تبديد الحرارة من الجيل التالي ، مما يجعل 10 Pro خيارًا ممتازًا للاعبي الأجهزة المحمولة.\nاشحن للأمام بشحن سريع 65 واط \/ شحن لاسلكي 50 واط | احصل على طاقة يوم كامل في 15 دقيقة مع شحن SuperVOOC 65W وفي 30 دقيقة مع الشحن اللاسلكي 50 واط.\nبطارية كبيرة بسعة 5000 مللي أمبير في الساعة | اقضِ وقتًا أقل في الاتصال بالشاحن الخاص بك باستخدام بطارية ضخمة بقوة 5000 مللي أمبير ، وهي مثالية للمستخدمين الذين يحتاجون إلى طاقة كبيرة.\nإمكانية استخدام Alexa بدون استخدام اليدين | قم بتنزيل تطبيق Alexa لاستخدام Alexa بدون استخدام اليدين. قم بتشغيل الموسيقى ، وإجراء المكالمات ، والاستماع إلى الأخبار ، وفتح التطبيقات ، والتنقل ، والمزيد ، كل ذلك باستخدام صوتك فقط ، أثناء التنقل.\nملحوظة: الترجمة العربية لكلمة \"LTPO 2.0\"هي \"أكسيد بولي سيليكون منخفض درجة الحرارة 2.0\"وكلمة \"SuperVOOC\"هي \"فوق الشحن السريع\".\n\nتحذير: إذا لم يكن جهازك يتلقى رسائل نصية أو يواجه خطأ عند إجراء مكالمات هاتفية ، فستحتاج إلى الاتصال بالدعم الفني للشركات لإضافة ميزة CDMALess.\n\nالمكونات المتضمنة:\n\nهاتف OnePlus 10 Pro\nمحول طاقة SuperVOOC بقوة 65 واط\nكابل Type-C\nدليل البدء السريع\nرسالة الترحيب\nمعلومات السلامة وبطاقة الضمان\nقاذف درج SIM\nمحول USB (من النوع A إلى النوع C)\n",
